from enum import Enum


class Filetype(Enum):
    pdf = ''
    word = ''
    excel = ''
    powerpoint = ''
    text = ''
    folder = ''
    binary = ''
    compressed = ''
    video = ''
    audio = ''
    image = ''

    def __str__(self):
        return self.name


class Mimetypes(Enum):
    compressed = ['zip', '7z', 'deb', 'pkg', 'rar', 'rpm', 'gz', 'tar', 'z', 'apk']
    pdf = ['pdf']
    word = ['doc', 'dot', 'docx', 'docm', 'dotx', 'dotm', 'docb', 'odt']
    excel = ['xls', 'xlt', 'xlsx', 'xlsm', 'xltx', 'xltm', 'xlsb', 'ods']
    powerpoint = ['ppt', 'pot', 'pps', 'pptx', 'pptm', 'potx', 'potm', 'ppsm', 'sldx', 'sldm', 'odp']

    def __str__(self):
        return self.name


